import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import './App.css';
import Layout from './hocs/Layout'
import Navbar from './Navbar/Navbar';
import Home from './Home';


//Computing and Engineering Sciences
import ComputingSteps from './ProtectedContent/ComputingSteps';
import Requirements from './ProtectedContent/Requirements';
import SchoolOfficer from './ProtectedContent/SchoolOfficer';
import HeadOfDepartment from './ProtectedContent/HeadOfDepartment';
import BabcockUniversityTeachingHospital from './ProtectedContent/BabcockUniversityTeachingHospital';
import DirectorStudentSupportServices from './ProtectedContent/DirectorStudentSupportServices';
import DirectorSecurityServices from './ProtectedContent/DirectorSecurityServices';
import DataandArchievesOfficer from './ProtectedContent/DataandArchievesOfficer';
import AdmissionsOfficer from './ProtectedContent/AdmissionsOfficer';
import SchoolOfficer2 from './ProtectedContent/SchoolOfficer2';
import OnlineRegistration from './ProtectedContent/Content';



import SignUp from './accounts/SignUp';
import LogIn from './accounts/LogIn';
import Logout from './accounts/Logout';
import Profile from './Profile';
import NotFound from './NotFound';
//Payment



function App() {
  return (
      <Router>
        <Layout>
          <div className="App">
            <Navbar />
            <div className="content">
              <Switch>
                <Route exact path = '/'>
                    <Home />
                </Route>



                {/*Protected content*/}

                <Route path = '/Content'  component = {Content} />



                {/*Authentication*/}
                <Route path = '/SignUp' component = {SignUp} />
                <Route path = '/LogIn' component = {LogIn} />
                <Route path = "/Profile" component = {Profile} />
                <Route path="/logout" component={Logout} />


                <Route path = "*" component = {NotFound} />
              </Switch>
            </div>
          </div>
        </Layout>
      </Router>
  );
}

export default App;
